import React from 'react';
import { motion } from 'framer-motion';
import CoffeeParticles from './CoffeeParticles';
import './Projects.css';

const Projects = () => {
  return (
    <section id="projects" className="projects">
      <div className="container">
        <motion.h2 
          className="section-title"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
          viewport={{ once: true }}
        >
          My Projects
        </motion.h2>
        <motion.p 
          className="section-subtitle"
          initial={{ opacity: 0 }}
          whileInView={{ opacity: 1 }}
          transition={{ delay: 0.2 }}
          viewport={{ once: true }}
        >
          Showcasing my work and achievements
        </motion.p>

        <div className="projects-grid">
          <motion.div 
            className="project-card"
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6 }}
            viewport={{ once: true }}
            whileHover={{ y: -10 }}
          >
            <div className="project-icon">
              <i className="fas fa-network-wired"></i>
            </div>
            <h3>Network Infrastructure</h3>
            <p>Designed and implemented enterprise-level network solutions with high availability and security.</p>
            <div className="project-tags">
              <span>Cisco</span>
              <span>Security</span>
              <span>Infrastructure</span>
            </div>
          </motion.div>

          <motion.div 
            className="project-card"
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 0.1 }}
            viewport={{ once: true }}
            whileHover={{ y: -10 }}
          >
            <div className="project-icon">
              <i className="fas fa-shield-alt"></i>
            </div>
            <h3>Cybersecurity</h3>
            <p>Implemented comprehensive security protocols and threat detection systems.</p>
            <div className="project-tags">
              <span>Security</span>
              <span>Firewall</span>
              <span>Monitoring</span>
            </div>
          </motion.div>

          <motion.div 
            className="project-card"
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 0.2 }}
            viewport={{ once: true }}
            whileHover={{ y: -10 }}
          >
            <div className="project-icon">
              <i className="fas fa-cloud"></i>
            </div>
            <h3>Cloud Solutions</h3>
            <p>Migrated legacy systems to cloud infrastructure with improved scalability and performance.</p>
            <div className="project-tags">
              <span>AWS</span>
              <span>Azure</span>
              <span>Migration</span>
            </div>
          </motion.div>
        </div>
      </div>
    </section>
  );
};

export default Projects;
